import React from "react";

import "./App.css";
import { FaFacebook } from "react-icons/fa";
import { FaSearch } from "react-icons/fa";
import { SiAirplayvideo } from "react-icons/si";
import { FaHome } from "react-icons/fa";
import { SiMarketo } from "react-icons/si";
import { HiUserGroup } from "react-icons/hi";
import { IoGameControllerOutline } from "react-icons/io5";
import TopbarMiddle from "./TopbarMiddle";


function Topbar() {
  return (
    <div className="top-bar">
      {/* left side */}
      <div className="leftside">
        <FaFacebook className="fb-logo"></FaFacebook>
        <div className="searchdiv">
          <FaSearch></FaSearch>
          <input className="search" placeholder="Search Facebook"></input>
        </div>
      </div>

      {/* middle side */}
      <div>
      <TopbarMiddle icon={<FaHome style={{height:'60px',width:'60px',}}></FaHome>} tittle="Home"></TopbarMiddle>
      <TopbarMiddle icon={<SiAirplayvideo></SiAirplayvideo>} tittle="Watch"></TopbarMiddle>
      <TopbarMiddle icon={<SiMarketo></SiMarketo>} tittle="Marketplace"></TopbarMiddle>
      <TopbarMiddle icon={<HiUserGroup></HiUserGroup>} tittle="Groups"></TopbarMiddle>
      <TopbarMiddle icon={<IoGameControllerOutline ></IoGameControllerOutline>} tittle="Gaimming"></TopbarMiddle>
       


      </div>
    </div>
  );
}

export default Topbar;
